import { FC } from "React";
import styled from "styled-components";
import contract from "../../media/icons/contract.png";
import book from "../../media/icons/book.png";
const ExpandedMenuContet = styled.div`
  position: absolute;
  background-color: white;
  margin-top: 10px;
  border: 1px solid #555;
`;

const MenuItem = styled.div`
  margin-top: 5px;
  &:hover {
    background-color: lightgray;
  }
`;
const Icon = styled.img`
  margin-left: 10px;
  padding-right: 10px;
`;
const PublicationsIcon = styled.img`
  margin-left: 13px;
  padding-right: 10px;
`;
const Label = styled.label`
  font-size: 80%;
  color: gray;
`;
const MenuLabel = styled.div`
  margin-bottom: 10px;
  margin-left: 10px;
`;
const Icon2 = styled.img`
  margin-left: 13px;
  padding-right: 5px;
  width: 22px;
`;
const Input = styled.input`
width:100%;
`;
export const ExpandedMenu: FC = () => {
  return (
    <ExpandedMenuContet>
      <Input type="szukaj" placeholder="Hello there" ></Input>
      <MenuLabel>
        <Label>Platform</Label>
      </MenuLabel>
      <MenuItem>
        <Icon src="./media/icons/house.png" alt="" />
        Home
      </MenuItem>
      <MenuItem>
        <PublicationsIcon src="./media/icons/Publications.png" alt="" />
        Publications
      </MenuItem>
      <MenuItem>
        <Icon src="./media/icons/people.png" alt="" />
        People
      </MenuItem>
      <MenuItem>
        <Icon src="./media/icons/entities.png" alt="" />
        Entities
      </MenuItem>
      <MenuItem>
        <Icon src="./media/icons/administration.png" alt="" />
        Administration
      </MenuItem>
      <MenuLabel>
        <Label>Workspaces</Label>
      </MenuLabel>
      <MenuItem>
        <Icon2 src={contract} alt="" />
        Client contract
      </MenuItem>
      <MenuItem>
        <Icon2 src={contract} alt="" />
        Supplier contract
      </MenuItem>
      <MenuItem>
        <Icon2 src="../../media/icons/entities.png" alt="" />
        Corporate
      </MenuItem>
      <MenuItem>
        <Icon2 src={book} alt="" />
        Group Norms
      </MenuItem>
      <MenuItem>
        <Icon2 src={contract} alt="" />
        Real estate contracts
      </MenuItem>
    </ExpandedMenuContet>
  );
};
